var MovieList = React.createClass({
  propTypes: {
    moviesElements: React.PropTypes.array.isRequired
  },

  render: function() {
    return (
      React.createElement('div', {},
        React.createElement('h1', {}, 'Lista filmów'),
        React.createElement('ul', {},
          this.props.moviesElements.map(function(movie) {
            return React.createElement(Movie, {key: moviesElements.id, movie: movie});
          })
        )
      )
    );
  }
});

var Movie = React.createClass({
  propTypes: {
    movie: React.PropTypes.object.isRequired
  },

  render: function() {
    return (
      React.createElement('li', {},
        React.createElement(MovieTitle, {title: this.props.movie.title}),
        React.createElement(MovieDescription, {desc: this.props.movie.desc}),
        React.createElement(MovieImage, {src: this.props.movie.src})
      )
    );
  }
});

var MovieTitle = React.createClass({
  propTypes: {
    title: React.PropTypes.string.isRequired,
  },

  render: function(){
    return React.createElement('h2', {}, this.props.title
      );
  }
});

var MovieDescription = React.createClass({
  propTypes: {
    desc: React.PropTypes.string.isRequired,
  },

  render: function(){
    return React.createElement('p', {}, this.props.desc
      );
  }
});

var MovieImage = React.createClass({
  propTypes: {
    src: React.PropTypes.string.isRequired,
  },

  render: function(){
    return React.createElement('img', {src: this.props.src}
      );
  }
});

var element = React.createElement(MovieList, {moviesElements: moviesElements});
ReactDOM.render(element, document.getElementById('app'));

